static inline void CGCanvas_draw_rectangle(struct tag_CGCanvas *this,TGColour colour,bool fill,
                                               TCoord x,TCoord y,TCoord x2,TCoord y2) {
   TPoint point[4];

   if (colour == GCOL_NONE)
      return;

   point[0].x = x;
   point[0].y = y;
   point[1].x = x2;
   point[1].y = y;
   point[2].x = x2;
   point[2].y = y2;
   point[3].x = x;
   point[3].y = y2;

   CGCoordSpace_point_array_utov(CAST_CGCoordSpace(&this->coord_space),4,point);

   if (point[0].y == point[1].y &&
       point[1].x == point[2].x &&
       point[2].y == point[3].y &&
       point[3].x == point[0].x) {
          CGCanvas_NATIVE_draw_rectangle(CAST_CGCanvas(this),colour,fill,
                                                point[0].x,point[0].y,
                                                point[2].x,point[2].y);
   }
   else {
      CGCanvas_NATIVE_draw_polygon(CAST_CGCanvas(this),colour,fill,
                                          4,point,TRUE);
   }
}

static inline void CGCanvas_draw_ellipse(struct tag_CGCanvas *this,TGColour colour,bool fill,
                                          TCoord x,TCoord y,TCoord rx,TCoord ry) {
   TPoint point[2];

   if (colour == GCOL_NONE)
      return;
   point[0].x = x;
   point[0].y = y;
   point[1].x = x + rx;
   point[1].y = y + ry;

   CGCoordSpace_point_array_utov(CAST_CGCoordSpace(&this->coord_space),2,point);
   point[1].x -= point[0].x;
   point[1].y -= point[0].y;
   CGCanvas_NATIVE_draw_ellipse(CAST_CGCanvas(this),colour,fill,
                                      point[0].x,point[0].y,
                                      point[1].x,point[1].y);
}

