void CSQLClientApp_write_message(struct tag_CSQLClientApp *this,int count,const unsigned char *data) {
   if (count == 0) {
      CSocket_send(CAST_CSocket(&this->socket),this->tx_buf,this->tx_buf_count,0);
      this->tx_buf_count = 0;
   }
   else {
      memcpy(&this->tx_buf[this->tx_buf_count], data, count);
      this->tx_buf_count += count;
   }
}                                

